function [y,y_std] = infbench_lumpy(x,infprob)
%INFBENCH_LUMPY Inference benchmark log pdf -- lumpy density.

if isempty(x)
    if isempty(infprob) % Generate this document
        rng(0);        
        fprintf('switch D\n');
        for D = 1:20
            M = 12; % Number of lumpy components            
            Mu = rand(M,D);
            Sigma = zeros(M,D,D);
            for m = 1:M
                ell2 = linspace(0.2,0.6,D).^2;
                Sigma(m,:,:) = diag(ell2(randperm(D)));                
            end
            w = -log(rand(M,1));    % Dirichlet distribution with alpha=1
            w = w / sum(w);
            
            % Get stats of Gaussian mixture
            [Mean,Cov,Mode] = gmmstats(w,Mu,Sigma);
                        
            fprintf('\tcase %d\n',D);
            fprintf('\t\tM = %d;\n',M);            
            fprintf('\t\tw = %s;\n',mat2str(w));
            fprintf('\t\tMu = %s;\n',mat2str(Mu));
            fprintf('\t\t');
            for m = 1:M
                fprintf('Sigma(%d,:,:) = %s; ',m,mat2str(squeeze(Sigma(m,:,:))));
            end
            fprintf('\n');
            fprintf('\t\tMean = %s;\n',mat2str(Mean));
            fprintf('\t\tCov = %s;\n',mat2str(Cov));            
            fprintf('\t\tMode = %s;\n',mat2str(Mode));
        end
        fprintf('\totherwise\n\t\terror(''%s:TooHighDim'',''Benchmark function supports up to D=20 dimensions.'');\n',mfilename);
